INSERT INTO `wp_options` VALUES("1902", "_transient_dash_5f25301ca0145abac6dfc3a0899dc43b", "<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/03/wordpress-4-7-3-security-and-maintenance-release/\'>WordPress 4.7.3 Security and Maintenance Release</a> <span class=\"rss-date\">6. 3. 2017</span><div class=\"rssSummary\">WordPress 4.7.3 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.7.2 and earlier are affected by six security issues: Cross-site scripting (XSS) via media file metadata.  Reported by Chris Andrè Dale, Yorick Koster, and Simon P. Briggs. Control characters can trick redirect [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wptavern.com/wordcamp-miami-2017-will-livestream-all-sessions-this-weekend\'>WPTavern: WordCamp Miami 2017 Will Livestream All Sessions this Weekend</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/medium-aims-to-fix-broken-media-with-new-5-subscription-program\'>WPTavern: Medium Aims to Fix ‘Broken’ Media with New $5 Subscription Program</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/how-to-find-the-age-of-a-plugin-hosted-in-the-wordpress-plugin-directory\'>WPTavern: How to Find the Age of a Plugin Hosted in the WordPress Plugin Directory</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Popular Plugin:</span> Ninja Forms&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=ninja-forms&amp;_wpnonce=146ea78727&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"Install Ninja Forms\">(Install)</a></li></ul></div>", "no");
